    "2016-10-22T17:46:21.102666",nt"name": "national-protocol-framework-for-the-inventory-and-monitoring-of-breeding-landbirds-using-p",nt"isopen":
    false,nt"url": null,nt"notes": "This protocol framework provides a tool
    for deleoping site-specific guidance on how to inventory or monitor breeding landbirds
    in North America by use of point counts.  The protocol is suitable for use in forests,
    shrublands, and grasslands and supports estimates of bird species abundance, occupancy,
    and detection probabilities.  The bird observation and recording methods described
    here accommodate the use of the time-removal method for estimating detection probabilities.
    The protocol framework addresses eight elements, including a protocol introduction,
    sampling design, field methods, data management, analysis, reporting, personnel
    requirements and training, operational requirements, and references. Additionally,
    a series of standard operating procedures provides greater detail on recommended
    methods and technical aspects of this protocol. This version replaces the 2008 version
    (1.0) with addition of instructions for data entry, archival, and multi-scale analysis
    handled through an online database that is part of the Avian Knowledge Network (AKN)
    and guidance for validating macrohabitat classification of sampling locations.",nt"license_title":
